angular.module("altairApp").controller("searchUserCtrl",function($rootScope,$scope,$interval,$timeout,$compile,$log,ReconstructMenu,showuserFactory){ReconstructMenu.Init(),$scope.dataListUser=[],$scope.show={main:!0,detail:!1},$timeout(function(){var success_get_data=function(data){$scope.dataListUser=data},error_get_data=function(data){$log.error("data : "+data,data)};showuserFactory.GetListData().then(success_get_data,error_get_data)},500),$scope.showDetail=function(data){$scope.selectedData=data,$scope.show.main=!1,$scope.show.detail=!0},$scope.back=function(){$scope.selectedData={},$scope.show.main=!0,$scope.show.detail=!1}}).factory("showuserFactory",function($timeout,$log,$http,ServerConfig,$q){var service={},searchUser={method:"GET",url:ServerConfig.production+"/neta/wifiid/search/search_user",headers:{}};return service.GetListData=function(){var deffered=$q.defer();return $http(searchUser).success(function(data,status,headers){deffered.resolve(data)}).error(function(data,status){$log.error(status)}),deffered.promise},service});